import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六壬日辛丑时断</p><p>六壬日生时辛丑，下有官星上印绶；</p><p>如通月气运西南，官印扶身人清秀。</p><p>壬日辛丑时，官印得位。</p><p>壬以己为官，辛为印，丑上金局，暗已得位，若通月气，为人清秀，禄贵安稳；不通，主性僻诡谲。</p><p>壬子日辛丑时，巳酉丑月，印绶，多受父母荫。</p><p>申月，火土运，近侍有权。</p><p>辰戌丑未，有官有印，丰资旷达，名播天涯。</p><p>寅午戌月，财破，禄印不成局，平常。</p><p>亥申年月，贵壬寅日辛丑时，丑月，杂气印绶高。</p><p>辰巳，煞强无制伏，财官身弱，辛苦。</p><p>壬辰日辛丑时，辰戌丑未，杂气财官印绶，俱吉。</p><p>春平，夏财禄，秋吉，中有凶。</p><p>冬身旺，须行南运方显。</p><p>壬午日辛丑时，禄马同乡，贵。</p><p>夏吉。</p><p>秋，财官印全，亦贵。</p><p>壬申日辛丑时，寅卯亥未年月，进士风宪，官至二品，终有起倒。</p><p>辰戌，富足。</p><p>申酉，享用自然，行北运亦贵。</p><p>壬戌日辛丑时，辰月，冲开财官，贵。</p><p>丑戌，亦吉。</p><p>柱有乙癸卯字，平常。</p><p>六壬日干辛丑时，官印相生事事奇；午月更通金土旺，为官清贵定无移。</p><p>壬日时临辛丑，财官印绶其中，要知开库钥匙通，戊己相逢火重。</p><p>癸卯乙字减福，有遇龙虎相冲。</p><p>只争迟早改门风，富贵承恩拜宠。</p>",27),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","264卷 九·六壬日辛丑时断.html.vue"]]);export{f as default};
